import React from "react";

const OutfitTryOn = () => {
  return (
    <div style={styles.container}>
      <h1>Outfit Try-On</h1>
      <p>Try on different outfits in real-time using AI-powered virtual try-on!</p>
    </div>
  );
};

const styles = {
  container: {
    textAlign: "center",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    height: "0vh",
  },
};

export default OutfitTryOn;
